import React from "react";
import './Start.css';
import {Link } from "react-router-dom";

    function StartPage() {

        return (
          <div className="StartPage">
            <p>
              MEMORY GAME
              <br />
              Click on the button below to go back to the home page.
            </p>
            <Link to="/"><button>
              Restart
            </button>
            </Link>
          </div>
        );

    }

export default StartPage;
